import React from 'react';

const Home = () => {
  return (
    <div style={{
      minHeight: '100vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      background: '#fff',
      color: '#333',
      fontSize: '24px',
      fontWeight: 600
    }}>
      Home
    </div>
  );
};

export default Home;
